INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, "リリ", 2, 1, 125801, 24001, 40011, 0, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, "クリア", 2, 2, 126001, 24001, 40011, 0, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (323, "んーと。\nこれ、あげる。\nはい", 1, "プレシア", 2, 3, 126101, 24001, 40011, 0, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, "リリ", 2, 4, 125801, 24001, 40011, 0, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, "クリア", 2, 5, 126001, 24001, 40011, 0, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (326, "お兄。\nきてくれて、うれしい", 2, "プレシア", 2, 6, 126101, 24001, 40011, 0, 1);
